import React from 'react';
import { AppBar, Toolbar, Typography, Button, Container } from '@mui/material';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: '#000000' }}>
      <Container>
        <Toolbar>
          <Typography
            component={Link}
            to="/"
            sx={{ 
              flexGrow: 1, 
              textDecoration: 'none', 
              color: '#FFFFFF',
              fontWeight: 'bold',
              letterSpacing: '1px',
              cursor: 'pointer'
            }}
          >
            COACH NATION AFRIKA
          </Typography>
          <Button 
            component={Link} 
            to="/" 
            color="inherit"
            sx={{ mx: 1 }}
          >
            Home
          </Button>
          <Button 
            component={Link} 
            to="/trainers" 
            color="inherit"
            sx={{ mx: 1 }}
          >
            Trainers
          </Button>
          <Button 
            component={Link} 
            to="/booking" 
            color="inherit"
            sx={{ mx: 1 }}
          >
            Book Session
          </Button>
          <Button 
            component={Link} 
            to="/contact" 
            color="inherit"
            sx={{ mx: 1 }}
          >
            Contact
          </Button>
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default Navbar;
